      const tipCount = 3; // Ê®°ÊãüÁàÜÊñôÊï∞Èáè

      setFeatureCounts(prev => 
        prev.map(item => {
          if (item.id === 2) return { ...item, count: browseHistoryCount };
          if (item.id === 4) return { ...item, count: tipCount };
          return item;
        })
