    { id: 2, name: 'ÂæÖÂèëË¥ß', icon: 'üöö', count: 1 },
    { id: 3, name: 'ÂæÖÊî∂Ë¥ß', icon: 'üì¶', count: 0 },
    { id: 4, name: 'ÂæÖËØÑ‰ª∑', icon: '‚≠ê', count: 3 },
    { id: 5, name: 'ÈÄÄÊ¨æ/ÂîÆÂêé', icon: '‚Ü©Ô∏è', count: 0 }
  ];

  return (
    <div className="profile-page">
      <div className="profile-header">
        <div className="avatar-section">
          <img src={userInfo.avatar} alt="Â§¥ÂÉè" className="avatar" />
          <div className="user-info">
            <h2>{userInfo.name}</h2>
            <div className="user-level">{userInfo.level}</div>
          </div>
        </div>
        <div className="user-stats">
          <div className="stat-item">
            <div className="stat-value">¬•{userInfo.balance}</div>
            <div className="stat-label">‰ΩôÈ¢ù</div>
          </div>
          <div className="stat-item">
            <div className="stat-value">{userInfo.points}</div>
            <div className="stat-label">ÁßØÂàÜ</div>
          </div>
        </div>
      </div>

      <div className="profile-features">
        {featureCounts.map(feature => (
          <div key={feature.id} className="feature-item">
            <div className="feature-icon">{feature.icon}</div>
            <div className="feature-name">{feature.name}</div>
            {feature.count > 0 && <div className="feature-count">{feature.count}</div>}
          </div>
        ))}
      </div>

      <div className="order-section">
        <div className="section-header">
          <h3>ÊàëÁöÑËÆ¢Âçï</h3>
          <span>Êü•ÁúãÂÖ®ÈÉ®</span>
        </div>
        <div className="order-types">
          {orders.map(order => (
            <div key={order.id} className="order-type">
              <div className="order-icon">{order.icon}</div>
              <div className="order-name">{order.name}</div>
