        </div>
        <div className="setting-item">
          <span>Ê∂àÊÅØÈÄöÁü•</span>
          <span className="arrow">‚Ä∫</span>
        </div>
        <div className="setting-item">
          <span>Ë¥¶Êà∑ÂÆâÂÖ®</span>
          <span className="arrow">‚Ä∫</span>
        </div>
        <div className="setting-item">
          <span>ÂÆ¢Êúç‰∏≠ÂøÉ</span>
